War Documentary hosted by Kate Fleming, published by Discovery Channel in 2000 - English narration &lt;a href=&quot;
http://docuwiki.net/images/7/74/Real-M.A.S.H-The-World-of-Combat-Medicine-Cover.jpg&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://docuwiki.net/images/7/74/Real-M.A.S.H-The-World-of-Combat-Medicine-Cover.jpg&lt;/a&gt;

Information
------------------------------

What is it like to be a soldier who goes to war to heal? Lt. Diane Carlson Evans, who served as a nurse in Vietnam, responds, &quot;Think of having a plane crash every day.&quot; This gritty program presents the history of the modern medic while tracking a class of prospective corpsmen training to earn the nickname &quot;Doc&quot; at the Navy's Field Medical School. Archival photos and rare film footage document hard-minded innovations of medical expediency from the Civil War to today, such as triage, field hospitals, and prosthetics. Pararescuemen and combat medics who served in Vietnam and Somalia talk about their experiences.

Produced by Hoggard Films for Discovery Channel

